import React from 'react';
import { Slide, Slider } from './components/Slider';
import image1 from './images/Slider_1/image_1.jpg';
import image2 from './images/Slider_1/image_2.jpg';
import image3 from './images/Slider_1/image_3.jpg';
import image4 from './images/Slider_1/image_4.jpg';
import image5 from './images/Slider_1/image_5.jpg';


function Slider_1() {

    return (
        <div>
            <div className="container">
                <Slider showNav>
                    <Slide bg={image1}></Slide>
                    <Slide bg={image2}></Slide>
                    <Slide bg={image3}></Slide>
                    <Slide bg={image4}></Slide>
                    <Slide bg={image5}></Slide>
                </Slider>
            </div>
        </div>
    )
}

export default Slider_1;
